If you're capable with Rust, you can register the new language yourself. Otherwise, I will do it after you submit your translations. First, in rust/aura-pm/src/lib.rs, we tell the Rust about the new locale: pub const LATIN: LanguageIdentifier = langid!("la-VA"); Then, within rust/aura-pm/src/localization.rs, we update the identifier_from_locale function to include the language code for Latin: pub(crate) fn identifier_from_locale<S>(locale: S) -> Option<LanguageIdentifier>
where S: AsRef<str>,
{ match code_and_country(locale.as_ref()) { ("en", _) => Some(aura_pm::ENGLISH), // ... other languages ... ("la", _) => Some(aura_pm::LATIN), _ => None, }
} Next, we add a command-line flag for Latin within rust/aura-pm/src/flags.rs: pub struct Args { /// Output in Latin (alias: Latinus). #[clap( group = "language", long, global = true, alias = "latinus", hide_short_help = true, display_order = 10 )] pub latin: bool, // ... more flags ... Thanks to the alias, we can turn on Latin with either --latin or --latinus. Make sure to add both variants to the AURA_GLOBALS list. This is important for interaction with Pacman. Finally, back in localization.rs, we can give credit to ourselves for having added Latin: pub(crate) const TRANSLATORS: &[(&str, &str)] = &[ // ... other languages ... ("Korean", "\"Nioden\""), ("Latin", "Maximus Decimus Meridius") ("Norwegian", "\"chinatsun\""), // ... other languages ...
]; Strength and honour, General.
